<script>
export default {
  name: 'SvgDetail',
  props: {
    selectedArea: {
      type: String
    },
    countyOption: {
      type: Array
    }
  },
  data () {
    return {
      areaMap: {
        '东江流域': 0,
        '韶关': 1,
        '深圳': 2,
        '惠州': 3,
        '东莞': 4,
        '广州': 5,
        '河源': 6
      }
    }
  },
  computed: {
    selectedAreaCode () {
      return this.areaMap[this.selectedArea]
    }
  },
  watch: {
    selectedAreaCode (newVal, oldVal) {
      var index = newVal - 1
      this.activeArea(index, 'click')
    }
  },
  mounted () {
    this.$nextTick(() => {
      this.initSvg()
    })
  },
  methods: {
    initSvg () {
      var that = this
      var emptyAreas = document.getElementsByClassName('empty_area')

      for (var i = 0; i < emptyAreas.length; i++) {
        var item = emptyAreas[i]
        if (item) {
          item.addEventListener('click', (function (index) {
            return function () {
              that.activeArea(index, 'click')

              //传递当前高亮地市给父级组件
              that.$emit('svgChangeArea', (index + 1).toString())
            }
          })(i))
          item.addEventListener('mouseover', (function (index) {
            return function () {
              that.activeArea(index, 'mouseover')
            }
          })(i))
          item.addEventListener('mouseout', (function (index) {
            return function () {
              that.deActiveArea(index)
            }
          })(i))
        }
      }
    },

    deActiveArea (index) {
      var fullAreas = document.getElementsByClassName('full_area')
      var areaLabels = document.getElementsByClassName('area_label')
      for (var j = 0; j < fullAreas.length; j++) {
        var fullArea = fullAreas[j]
        var areaLabel = areaLabels[j]
        var actived = fullArea.getAttribute('data-actived')
        if (fullArea && (!actived || actived === 'false')) {
          fullArea.style.display = 'none'
          areaLabel.setAttribute('class', 'area_label')
        }
      }
    },

    activeArea (index, handle) {
      var fullAreas = document.getElementsByClassName('full_area')
      var areaLabels = document.getElementsByClassName('area_label')

      for (var j = 0; j < fullAreas.length; j++) {
        var fullArea = fullAreas[j]
        var areaLabel = areaLabels[j]

        // 如果是鼠标经过事件，则不清空当前高亮的区块
        if (handle === 'mouseover') {
          var actived = fullArea.getAttribute('data-actived')
          if (fullArea && (!actived || actived === 'false')) {
            fullArea.style.display = 'none'
            areaLabel.setAttribute('class', 'area_label')
          }
        } else {

          // 如果是点击事件的话，则先清除所有区块的高亮标识
          fullArea.setAttribute('data-actived', 'false')
          fullArea.style.display = 'none'
          areaLabel.setAttribute('class', 'area_label')
        }
      }

      var targetArea = fullAreas[index]
      var targetLable = areaLabels[index]

      if (targetArea) {
        targetArea.style.display = ''
        targetLable.setAttribute('class', 'area_label actived')

        // 如果是点击事件的话，则为当前点击的区块添加高亮标识
        if (handle === 'click') {
          targetArea.setAttribute('data-actived', 'true')
        }
      }
    }
  }
}
</script>
<style lang="scss">
.area_label text {
  fill: #00cad7;
  font-weight: bold;
}

.area_label.actived text {
  fill: #ffffff;
}
</style>
